import React from 'react';
import { Navigate } from 'react-router-dom';
import { fetchDataFromAPI, postDataToAPI, putDataToAPI } from './apiService';

const Dashboard = () => {
  // Check if the user is authenticated based on user_id.
  const user_id = sessionStorage.getItem('user_id');

  // If user_id is not present in sessionStorage, redirect to login.
  if (!user_id) {
    return <Navigate to="/login" replace />;
  }

  // Render the Dashboard component if user_id is available.
  return (
    <div>
      {/* Your Dashboard content here */}
      <h1>Welcome to the Dashboard</h1>
      {/* Add your Dashboard content */}
    </div>
  );
};

export default Dashboard;
